import React from "react";

const VerticalNavBar = () => {
  return (
    <div className="vertical-navbar">
      <a href="#home">Home</a>
      <a href="#services">Friends</a>
      <a href="#about">List</a>
    </div>
  );
};

export default VerticalNavBar;
